ntion, which has allowed Saudi women to take confident and steady steps toward realizing their aspirations and has given them the opportunity to demonstrate excellence in various fields. They have been able to stand out, not only at the domestic level, but also on the international stage, where Saudi women are becoming well-known scholars and intellectuals. They have made a name for themselves in international forums and in various fields of science, achieving success and proving themselves at least as competent as their peers in other developed countries.','English','Hashir','2021-11-17 09:55:22','PNU','2022-01-04 00:44:52'),(15,13,'about_program','Virtual Reality Courses','English','Hashir','2021-11-17 09:55:22','PNU','2021-12-27 10:19:16'),(16,13,'about_pnu',NULL,'Arabic','Hashir','2021-11-17 09:55:22','PNU','2021-12-30 07:18:59'),(17,13,'about_program',NULL,'Arabic','Hashir','2021-11-17 09:55:22','PNU','2021-12-30 07:18:59'),(56,15,'choices','Woman A','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(57,16,'choices','Man A','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(58,17,'choices','Man D','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(59,18,'choices','Woman B','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(60,19,'choices','Because there is only 1 female candidate, her chances of being hired is higher than the male candidates.','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(61,20,'choices','It is necessary to assess the female candidates social status and responsibilities (familial responsibilities) before hiring her','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(62,21,'choices','The hiring committee should inquire about the female candidates leadership abilities prior to finalizing its decision.','English','Hashir','2021-11-17 13:22:55','Hashir','2021-11-17 13:22:55'),(63,22,'choices','Gender should 