 about what we are looking for and what our strategy and vision is for the organization and the IT division/department.','English','0:11:00','0:20:07','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(279,30,'Welcome.','English','0:20:20','0:22:05','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(280,30,'Please, have a seat.','English','0:22:10','0:23:13','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(281,30,'Should we begin the meeting?','English','0:23:16','0:33:12','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(282,30,'Sure. We received many CVs for potential hiring to lead our IT division/department. And we have narrowed it down to 3 CVs and they are the most suitable and qualified. I believe this team received copies of the CVs and had the time to review them. Oh, let me emphasize that one of the candidates is a woman.','English','0:33:20','0:44:09','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(283,30,'I think the female candidate should be hired for this position. This will help increase our gender equality quota.','English','0:45:00','0:50:21','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(284,30,'We dont need a woman to lead this division/department.','English','0:51:07','0:53:19','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(285,30,'The female candidate is married and has children. She will be busy being a mother and not attend to the needs of the department','English','0:55:00','1:02:22','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(286,30,'I think you are qualified to lead the department.','English','1:03:06','1:05:07','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(287,30,'Why dont we hire her? Shes qualified.','English','1:05:04','1:07:23','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(288,30,'You sure you came to the right place at the right time.','English','1:08:22','1:12:20','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(289,30,'My dear, we are discussing the 3 candidates today.','English','1:13:17','1:16:16','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(290,30,'gggggggggggggggggggggggg','English','0:04:11','0:04:11','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(291,30,'M today.','English','1:13:17','1:16:16','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(292,30,'test2','English','00:55:00','00:55:05','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(293,30,'Hello','English','03:03:77','04:04:05','PNU','2021-12-21 10:33:21','PNU','2021-12-21 10:33:21'),(416,21,'Thank you for being here. I would like to introduce you to our executive team.','English','0:20:700','0:25:200','PNU','2021-12-26 15:11:30','PNU','2021-12-26 15:11:30'),(417,21,'I invited an external IT consultant to provide us with insight and feedback on the candidates we will be discussing in this meeting.','English','0:27:500','0:34:100','PNU','2021-12-26 15:11:30','PNU','2021-12-26 15:11:30'),(418,21,'Also, shes a good friend of mine and trustworthy. I briefed her about what we are looking for and what our strategy and vision is for the organization and the IT division/department.','English','0:35:000','0:45:800','PNU','2021-12-26 15:11:30','PNU','2021-12-26 15:11:30'),(419,21,'Should we begin the meeting?','English','0:49:500','0:50:400','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(420,21,'Sure. We received many CVs for potential hiring to lead our IT division/department. And we have narrowed it down to 3 CVs and they are the most suitable and qualified. I believe this team received copies of the CVs and had the time to review them. Oh, let me emphasize that one of the candidates is a woman.','English','0:50:950','01:11:000','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(421,21,'I think the female candidate should be hired for this position. This will help increase our gender equality quota.','English','01:12:100','01:17:700','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(422,21,'We dont need a woman to lead this division/department.','English','01:18:300','01:20:600','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(423,21,'The female candidate is married and has children. She will be busy being a mother and not have time to attend to the needs of the department','English','1:22:100','1:29:700','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(424,21,'I think you are qualified to lead the department.','English','1:30:500','1:32:200','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(425,21,'Why dont we hire her? Shes qualified.','English','1:32:600','1:34:500','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(426,21,'You sure you came to the right place at the right time.','English','1:36:200','1:39:600','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(427,21,'My dear, we are discussing the 3 candidates today.','English','1:40:900','1:43:500','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31'),(428,21,'Welcome','English','0:46:700','0:47:500','PNU','2021-12-26 15:11:31','PNU','2021-12-26 15:11:31');
